import React from 'react';
import logo from './logo.svg';
import './App.css';
interface IProps {
}

interface IState {
  time: string;
  value: number
}
class App extends React.Component<IProps, IState> {
  constructor(props: any) {
    super(props);
    this.state = {
        time: new Date().toLocaleTimeString(),
        value: 1
    }
  }
  render() {
    return (
    <div>
      <div>Hello world!</div>
      <div>
        Time now: {this.state.time}{this.state.value}
      </div>
    </div>
  );
    }
}

export default App;
